// src/pages/EnquiryForm.jsx
import React, { useState } from "react";
import { useLocation } from "react-router-dom";
import { useCreateEnquiryMutation } from "../../redux/api/bookingApi";
import Footer from "../Footer";
import Header from "../Header";

const EnquiryForm = () => {
  const location = useLocation();
  const queryParams = new URLSearchParams(location.search);

  const flightId = queryParams.get("flightId") || "";
  const from = queryParams.get("from") || "";
  const to = queryParams.get("to") || "";
  const travelDate = queryParams.get("date") || "";
  const travelTime = queryParams.get("time") || "";
  const pax = queryParams.get("pax") || "";

  const [formData, setFormData] = useState({
    name: "",
    phone: "",
    email: "",
    date: travelDate,
    time: travelTime,
    remark: "",
  });

  const [createEnquiry, { isLoading, isSuccess, isError, error }] =
    useCreateEnquiryMutation();

  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();

    const enquiryPayload = {
      ...formData,
      flightId,
      from,
      to,
      pax,
    };

    try {
      await createEnquiry(enquiryPayload).unwrap();
      alert("Enquiry submitted successfully!");
    } catch (err) {
      console.error("Enquiry error:", err);
      alert("Failed to submit enquiry");
    }
  };

  return (
    <>
      <Header />
      <div className="login-sec-container enquiry-sec-container">
        <div className="login-sec-form">
          <div className="form-flex mt-30">
            <form className="form" onSubmit={handleSubmit}>
              <div className="heading mb-30">Enquiry Form</div>

              <div className="input-box">
                <label htmlFor="name">What’s your good name?</label>
                <div className="input-flex">
                  <input
                    type="text"
                    name="name"
                    placeholder="John Doe"
                    value={formData.name}
                    onChange={handleChange}
                    required
                  />
                </div>
              </div>

              <div className="input-box">
                <label htmlFor="phone">What’s your Mobile No.?</label>
                <div className="input-flex">
                  <input
                    type="text"
                    name="phone"
                    placeholder="9876543210"
                    value={formData.phone}
                    onChange={handleChange}
                    required
                  />
                </div>
              </div>

              <div className="input-box">
                <label htmlFor="email">What’s your email?</label>
                <div className="input-flex">
                  <input
                    type="email"
                    name="email"
                    placeholder="john.doe@mail.com"
                    value={formData.email}
                    onChange={handleChange}
                    required
                  />
                </div>
              </div>

              <div className="input-flex-half">
                <div className="input-box">
                  <label htmlFor="date">Travel Date</label>
                  <div className="input-flex">
                    <input
                      type="date"
                      name="date"
                      value={formData.date}
                      onChange={handleChange}
                      required
                    />
                  </div>
                </div>

                <div className="input-box">
                  <label htmlFor="time">Travel Time</label>
                  <div className="input-flex">
                    <input
                      type="time"
                      name="time"
                      value={formData.time}
                      onChange={handleChange}
                      required
                    />
                  </div>
                </div>
              </div>

              <div className="input-box">
                <label htmlFor="remark">Remark</label>
                <div className="input-flex">
                  <textarea
                    name="remark"
                    rows="4"
                    placeholder="Any special request..."
                    value={formData.remark}
                    onChange={handleChange}
                  />
                </div>
              </div>

              <div className="form-button">
                <input
                  type="submit"
                  disabled={isLoading}
                  value={isLoading ? "Submitting..." : "Submit Enquiry"}
                />
              </div>

              {isSuccess && <p style={{ color: "green" }}>Enquiry saved ✅</p>}
              {isError && (
                <p style={{ color: "red" }}>
                  Error: {error?.data?.message || "Something went wrong"}
                </p>
              )}
            </form>
          </div>
        </div>
      </div>
      <Footer />
    </>
  );
};

export default EnquiryForm;
